import { useState } from "react";
import BookList from "./book-list";
import SearchBar from "./search-bar";

const Home = () => {
    const [books, setBooks] = useState([
        {
            "id": 1,
            "title": "Oedipus at Colonus",
            "author": "Jebb, Richard Claverhouse, Sir, 1841-1905",
            "date": "1930",
            "status": "free"
        },
        {
            "id": 2,
            "title": "The Iliad",
            "author": "Bryant, William Cullen, 1794-1878",
            "date": "c1870",
            "status": "free"
        },
        {
            "id": 3,
            "title": "The Prometheus",
            "author": "Buckley, Theodore Alois, 1825-1856",
            "date": "1899",
            "status": "free"
        },
        {
            "id": 4,
            "title": "Parmenides",
            "author": "Maguire, Thomas, 1831-1889",
            "date": "1882",
            "status": "free"
        }]);

    return ( 
        <div className="home">
            <SearchBar />
            <BookList books={books} title='Books'/>
        </div>
     );
}

export default Home;
